Here is a Solidity contract based on the requirements. This contract is not fully functional and it's just a starting point. Please adjust according to your needs.

```solidity
pragma solidity >=0.4.22 <0.9.0;

contract MyContract {

    address public owner;
    uint256 public totalsupply;
    mapping (address => uint256) public balanceof;
    mapping (address => mapping (address => uint256)) public allowance;
    uint256 public creationblock;
    uint256 public ethsliceamount;
    uint256 public ethslicecap;
    mapping (address => uint256) public blocklockof;

    constructor() public {
        owner = msg.sender;
        totalsupply = 0xde0b6b3a7640000;
        balanceof[msg.sender] = totalsupply;
        creationblock = block.number;
    }

    function approve(address _spender, uint256 _value) public returns (bool success) {
        require(_spender != address(0));
        if(_value == 0){
            allowance[msg.sender][_spender] = _value;
        } else if(_value != 0 && allowance[msg.sender][_spender] == 0){
            allowance[msg.sender][_spender] = _value;
        }
        return true;
    }

    function transferFrom(address _from, address _to, uint256 _value) public returns (bool success) {
        require(_from != address(0) && _to != address(this) && _to != address(0) && block.number >= blocklockof[_from]);
        balanceof[_to] += _value;
        balanceof[_from] -= _value;
        allowance[_from][msg.sender] -= _value;
        return true;
    }

    function withdrawToken(address _tokenContract) public {
        require(msg.sender == owner && _tokenContract != address(this));
        Token token = Token(_tokenContract);
        uint256 v0 = token.balanceOf(address(this));
        if(msg.data.length >= 32) {
            token.transfer(owner, v0);
        }
    }

    function donateETHToMainPot() public payable {
        require(msg.value > 0);
        ethslicecap += msg.value;
    }

    function donateTokensToMainPot(uint256 _value) public {
        balanceof[msg.sender] -= _value;
        balanceof[address(this)] += _value;
        ethsliceamount += _value;
    }

    //... rest of the functions

}

contract Token {
    function balanceOf(address _owner) public view returns (uint256 balance);
    function transfer(address _to, uint256 _value) public returns (bool success);
}
```
Please note that Solidity does not support external function calls with dynamic argument list, so the functions `tokenFallback` in the `transfer` function with 3 arguments could not be implemented. Additionally, `RETURNDATASIZE` operation was not used as it's not applicable in high-level Solidity. Also, the calculation of new `blocklockof` in `transfer` function with 2 arguments is not clear and seems to contradict itself in your description, so it was not implemented.

Please adjust the contract according to your needs and make sure to thoroughly test it before any use on a live network.
